  `upleve_function` varchar(50) DEFAULT NULL COMMENT '升级方法',
  `upleve_value` varchar(500) DEFAULT NULL COMMENT '升级配置',
  `dividend_fun_name` varchar(50) DEFAULT '' COMMENT '佣金算法名',
  `dividend_function` varchar(50) DEFAULT NULL COMMENT '佣金算法',
  `dividend_value` varchar(500) DEFAULT NULL COMMENT '佣金配置',
  `add_time` int(10) DEFAULT NULL COMMENT '添加时间',
  `update_time` int(10) DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`role_id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='分销身份表';

