DROP TABLE IF EXISTS `main_log_sys`;

CREATE TABLE `main_log_sys` (
  `log_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `log_ip` varchar(20) CHARACTER SET utf8 DEFAULT '' COMMENT '记录IP',
