/*Table structure for table `main_menu_list` */

DROP TABLE IF EXISTS `main_menu_list`;

CREATE TABLE `main_menu_list` (
  `id` mediumint(8) NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `name` varchar(50) DEFAULT '' COMMENT '菜单名称',
  `controller` varchar(50) DEFAULT '' COMMENT '控制器',
  `action` varchar(25) DEFAULT '' COMMENT '功能',
  `urls` varchar(255) DEFAULT '' COMMENT '子菜单列',
  `key` varchar(30) DEFAULT '' COMMENT '菜单key',
  `parent` varchar(30) DEFAULT '' COMMENT '所属上级',
  `group` varchar(20) DEFAULT '' COMMENT '所属分组',
  `right` varchar(20) DEFAULT '' COMMENT '权限',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态',
  `icon` varchar(20) DEFAULT '' COMMENT '图标',
  `sort_order` tinyint(1) DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`),
  KEY `parent` (`parent`),
  KEY `right` (`right`)
) ENGINE=MyISAM AUTO_INCREMENT=85 DEFAULT CHARSET=utf8mb4 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='后台菜单列表';

