/*Table structure for table `main_payment` */

DROP TABLE IF EXISTS `main_payment`;

CREATE TABLE `main_payment` (
  `pay_id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT,
  `pay_code` varchar(20) NOT NULL DEFAULT '' COMMENT '支付编号',
  `pay_name` varchar(120) NOT NULL DEFAULT '' COMMENT '支付名称',
  `is_pay` tinyint(1) DEFAULT '0' COMMENT '是否需要支付',
  `def_config` varchar(500) NOT NULL DEFAULT '' COMMENT '支付配置定义',
  `pay_config` text COMMENT '支付参数',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否启用',
  `is_cod` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否货到付款',
  `is_online` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否在线支付',
  `img` varchar(50) DEFAULT '' COMMENT '图片',
  `pay_desc` varchar(255) DEFAULT '' COMMENT '支付简介',
  `sort_order` tinyint(3) DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`pay_id`),
  UNIQUE KEY `pay_code` (`pay_code`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

/*Data for the table `main_payment` */

