/*Table structure for table `main_payment_log` */

DROP TABLE IF EXISTS `main_payment_log`;

CREATE TABLE `main_payment_log` (
  `log_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `pay_sn` varchar(20) DEFAULT '' COMMENT '支付编号',
  `pay_id` tinyint(3) DEFAULT '0' COMMENT '支付ID',
  `pay_name` varchar(50) DEFAULT '' COMMENT '支付名称',
  `log_time` int(10) DEFAULT '0' COMMENT '记录时间',
  `pay_time` int(10) DEFAULT '0' COMMENT '支付时间',
  `return_time` int(10) DEFAULT '0' COMMENT '退还时间',
  `pay_total` decimal(10,2) DEFAULT '0.00' COMMENT '支付金额',
  `status` tinyint(1) DEFAULT '0' COMMENT '0待支付，1已支付，1支付关闭，9已退',
  `type` set('order_pay','recharge') DEFAULT NULL COMMENT '类型，订单支付，充值支付',
  `by_id` int(10) DEFAULT NULL COMMENT '对应id',
  `by_info` varchar(255) DEFAULT '' COMMENT '对应内容，订单编号，充值的内容',
  `user_id` mediumint(8) DEFAULT '0' COMMENT '会员ID',
  `serial_number` varchar(100) DEFAULT '' COMMENT '支付流水号',
  PRIMARY KEY (`log_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4;

