/*Table structure for table `main_pub_dict` */

DROP TABLE IF EXISTS `main_pub_dict`;

CREATE TABLE `main_pub_dict` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pid` mediumint(8) DEFAULT '0' COMMENT '上一级ID（0：主题  0以外：主题明细）',
  `dict_group` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '' COMMENT '字典识别代码',
  `dict_key` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '' COMMENT '字典明细编号',
  `dict_val` varchar(50) DEFAULT '' COMMENT '字典明细值',
  `ext_value` varchar(50) DEFAULT '' COMMENT '额外扩展值',
  `sort_order` tinyint(3) DEFAULT '0' COMMENT '主题明细排序',
  `isdel` tinyint(1) DEFAULT '0' COMMENT '是否删除（0：正常、1：已删除）',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='字典表';

