/*Table structure for table `main_region` */

DROP TABLE IF EXISTS `main_region`;

CREATE TABLE `main_region` (
  `id` int(10) unsigned NOT NULL COMMENT '区域ID',
  `pid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属上级',
  `name` varchar(20) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '全称',
  `merger_name` varchar(50) CHARACTER SET utf8 DEFAULT '' COMMENT '名称组合',
  `short_name` varchar(20) CHARACTER SET utf8 DEFAULT '' COMMENT '简称',
  `merger_short_name` varchar(50) CHARACTER SET utf8 DEFAULT '' COMMENT '简称组合',
  `level_type` tinyint(1) DEFAULT '0' COMMENT '级别',
  `city_code` decimal(10,0) DEFAULT '0' COMMENT '区域编号',
  `zip_code` mediumint(6) DEFAULT '1' COMMENT '邮编',
  `pin_yin` varchar(30) CHARACTER SET utf8 DEFAULT '' COMMENT '拼音',
  `jian_pin` varchar(15) CHARACTER SET utf8 DEFAULT '' COMMENT '简拼',
  `first_char` char(1) CHARACTER SET utf8 DEFAULT NULL COMMENT '首字母',
  `lng` float(10,6) DEFAULT '0.000000' COMMENT '纬度',
  `lat` float(10,6) DEFAULT '0.000000' COMMENT '经度',
  `remarks` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '备注',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态',
  `update_time` int(10) DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `update_time` (`update_time`),
  KEY `pid` (`pid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='区域表';

