/*Table structure for table `shop_cart` */

DROP TABLE IF EXISTS `shop_cart`;

CREATE TABLE `shop_cart` (
  `rec_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `session_id` char(32) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '用户SESSION_ID',
  `brand_id` mediumint(8) DEFAULT '0' COMMENT '品牌id',
  `cid` mediumint(8) DEFAULT '0' COMMENT '商品分类',
  `is_dividend` tinyint(1) DEFAULT '0' COMMENT '是否分销商品',
  `goods_id` mediumint(8) DEFAULT '0' COMMENT '商品ID',
  `sku_name` varchar(100) DEFAULT '' COMMENT '规格',
  `sku_val` varchar(100) DEFAULT '' COMMENT '规格值',
  `goods_sn` varchar(60) DEFAULT '' COMMENT '商品货号',
  `goods_name` varchar(120) DEFAULT '' COMMENT '商品名称',
  `market_price` decimal(10,2) DEFAULT '0.00' COMMENT '市场售价',
  `shop_price` decimal(10,2) DEFAULT '0.00' COMMENT '商品售价',
  `goods_price` decimal(10,2) DEFAULT '0.00' COMMENT '实阶售价',
  `goods_weight` decimal(10,2) DEFAULT '0.00' COMMENT '商品重量',
  `discount` decimal(10,2) DEFAULT '0.00' COMMENT '商品优惠金额，原售价与当前价',
  `buy_again_discount` decimal(10,2) DEFAULT '0.00' COMMENT '复购折扣',
  `goods_number` smallint(5) DEFAULT '0' COMMENT '订购数量',
  `is_integral` tinyint(1) DEFAULT '0' COMMENT '是否积分商品',
  `pic` varchar(255) DEFAULT '' COMMENT '图片',
  `use_integral` int(10) DEFAULT '0' COMMENT '消费积分',
  `add_time` int(10) DEFAULT '0' COMMENT '添加时间',
  `is_select` tinyint(1) DEFAULT '1' COMMENT '是否选中',
  `is_invalid` tinyint(1) DEFAULT '0' COMMENT '是否无效',
  PRIMARY KEY (`rec_id`),
  KEY `session_id` (`session_id`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;

