/*Table structure for table `shop_goods` */

DROP TABLE IF EXISTS `shop_goods`;

CREATE TABLE `shop_goods` (
  `goods_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `store_id` mediumint(8) DEFAULT '0' COMMENT '0为平台商品，其它为门店商品',
  `cid` mediumint(8) DEFAULT '0' COMMENT '所属分类',
  `brand_id` mediumint(8) DEFAULT '0' COMMENT '所属品牌',
  `supply_id` mediumint(8) DEFAULT '0' COMMENT '供应商ID',
  `sku_model` mediumint(8) DEFAULT '0' COMMENT '规格模型ID',
  `type_model` mediumint(8) DEFAULT '0' COMMENT '类型模型',
  `is_dividend` tinyint(1) DEFAULT '0' COMMENT '是否参与分销',
  `dividend_num` tinyint(3) DEFAULT '0' COMMENT '分销计算数量',
  `goods_name` varchar(120) DEFAULT '' COMMENT '商品名称',
  `short_name` varchar(80) DEFAULT '' COMMENT '商品简称',
  `goods_sn` varchar(60) DEFAULT '' COMMENT '商品货号',
  `bar_code` varchar(60) DEFAULT '' COMMENT '商品条形码',
  `goods_number` smallint(5) DEFAULT '0' COMMENT '商品库存',
  `goods_weight` decimal(10,2) DEFAULT '0.00' COMMENT '商品重量',
  `is_spec` tinyint(1) DEFAULT '0' COMMENT '是否多规格',
  `market_price` decimal(10,2) DEFAULT '0.00' COMMENT '市场售价',
  `shop_price` decimal(10,2) DEFAULT '0.00' COMMENT '商城售价',
  `show_price` decimal(10,2) DEFAULT '0.00' COMMENT '显示售价，多规格时为显示的价格',
  `sort_price` decimal(10,2) DEFAULT '0.00' COMMENT '此价格用于排序，记录当前最优惠价格',
  `settle_price` decimal(10,2) DEFAULT '0.00' COMMENT '结算价，门店与平台的结算价',
  `min_price` decimal(10,2) DEFAULT '0.00' COMMENT '最小金额',
  `max_price` decimal(10,2) DEFAULT '0.00' COMMENT '最大金额',
  `level_price_type` tinyint(1) DEFAULT '0' COMMENT '会员价格优惠方式,0默认商城售价,1会员折扣售价,2指定折扣售价,3指定固定售价',
  `role_price_type` tinyint(1) DEFAULT '0' COMMENT '身份价格优惠方式,0默认商城售价,1指定折扣售价,2指定固定售价',
  `volume_price_type` tinyint(1) DEFAULT '0' COMMENT '阶梯价格定义方式，1固定金额，2指定折扣',
  `keywords` varchar(255) DEFAULT '' COMMENT '关键字',
  `description` varchar(255) DEFAULT '' COMMENT '简介',
  `m_goods_desc` text COMMENT '移动端详细说明',
  `goods_desc` text COMMENT '详细说明',
  `goods_thumb` varchar(255) DEFAULT '' COMMENT '小图',
  `goods_img` varchar(255) DEFAULT '' COMMENT '原图',
  `sale_num` mediumint(8) DEFAULT '0' COMMENT '销量',
  `collect_num` mediumint(8) DEFAULT '0' COMMENT '收藏量',
  `virtual_sale` mediumint(8) DEFAULT '0' COMMENT '虚拟销量',
  `virtual_collect` mediumint(8) DEFAULT '0' COMMENT '虚拟收藏',
  `quota_amount` int(10) DEFAULT '0' COMMENT '单次商品限购数量',
  `is_delete` tinyint(1) DEFAULT '0' COMMENT '是否删除',
  `is_best` tinyint(1) DEFAULT '0' COMMENT '是否推荐',
  `is_hot` tinyint(1) DEFAULT '0' COMMENT '是否热销',
  `is_new` tinyint(1) DEFAULT '0' COMMENT '是否新品',
  `is_alone_sale` tinyint(1) DEFAULT '0' COMMENT '1表示能作为普通商品销售，否则只能作为配件或赠品销售。',
  `isputaway` tinyint(1) DEFAULT '0' COMMENT '上架时间:0-下架，1-上架，2-自动上下架',
  `added_time` int(10) DEFAULT '0' COMMENT '自动上架时间',
  `shelf_time` int(10) DEFAULT '0' COMMENT '自动下架时间',
  `add_time` int(10) DEFAULT '0' COMMENT '添加时间',
  `update_time` int(10) DEFAULT '0' COMMENT '修改时间',
  `freight_template` mediumint(8) DEFAULT '0' COMMENT '运费模板',
  `shippingfee_info` varchar(20) DEFAULT '' COMMENT '运费说明',
  `use_bond` tinyint(1) DEFAULT '1' COMMENT '能否使用优惠券1可用，0不可用',
  `is_promote` tinyint(1) DEFAULT '0' COMMENT '是否开启促销',
  `promote_price` decimal(10,2) DEFAULT '0.00' COMMENT '促销价',
  `promote_start_date` int(10) DEFAULT '0' COMMENT '促销开始时间',
  `promote_end_date` int(10) DEFAULT '0' COMMENT '促销结束时间',
  `limit_user_level` varchar(50) DEFAULT '' COMMENT '限制会员等级购买',
  `limit_user_role` varchar(50) DEFAULT '' COMMENT '限制会员身份购买',
  `give_integral_type` tinyint(1) DEFAULT '0' COMMENT '赠送消费积分方式',
  `give_integral` int(11) DEFAULT '0' COMMENT '赠送消费积分数',
  `rank_integral_type` tinyint(1) DEFAULT '0' COMMENT '赠送等级积分方式',
  `rank_integral` int(11) DEFAULT '0' COMMENT '赠送等级积分数',
  `use_integral` int(11) DEFAULT '0' COMMENT '购买该商品时需要使用的积分，积分组合购买时使用',
  `sort_order` smallint(4) DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`goods_id`),
  KEY `goods_sn` (`goods_sn`),
  KEY `cat_id` (`cid`),
  KEY `update_time` (`update_time`),
  KEY `brand_id` (`brand_id`),
  KEY `promote_end_date` (`promote_end_date`),
  KEY `promote_start_date` (`promote_start_date`),
  KEY `sort_order` (`sort_order`),
  KEY `is_field` (`store_id`,`is_delete`,`is_best`,`is_hot`,`is_new`,`is_alone_sale`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='商品表';

