/*Table structure for table `shop_goods_attribute` */

DROP TABLE IF EXISTS `shop_goods_attribute`;

CREATE TABLE `shop_goods_attribute` (
  `attr_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `model_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '所属模型ID',
  `attr_name` varchar(60) DEFAULT '' COMMENT '属性名称',
  `attr_input_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '录入方式',
  `attr_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '属性是否可选',
  `attr_values` text NOT NULL COMMENT '可选值列表',
  `attr_index` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '能否进行检索',
  `sort_order` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `attr_group` tinyint(1) NOT NULL DEFAULT '0' COMMENT '属性分组',
  `update_time` int(10) DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`attr_id`),
  KEY `cat_id` (`model_id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='商品类型属性表';

