/*Table structure for table `shop_goods_attribute_val` */

DROP TABLE IF EXISTS `shop_goods_attribute_val`;

CREATE TABLE `shop_goods_attribute_val` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '商品ID',
  `model_id` smallint(5) DEFAULT '0' COMMENT '商品类型ID',
  `attr_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '商品属性ID',
  `attr_value` text NOT NULL COMMENT '内容',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `attr_id` (`attr_id`),
  KEY `type_id` (`model_id`)
) ENGINE=InnoDB AUTO_INCREMENT=64 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='商品属性表';

