/*Table structure for table `shop_goods_brand` */

DROP TABLE IF EXISTS `shop_goods_brand`;

CREATE TABLE `shop_goods_brand` (
  `id` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `cid` mediumint(8) DEFAULT '0' COMMENT '分类Id',
  `name` varchar(60) NOT NULL DEFAULT '' COMMENT '品牌名',
  `m_name` varchar(20) DEFAULT '' COMMENT '简称',
  `logo` varchar(80) NOT NULL DEFAULT '' COMMENT '品牌logo',
  `is_hot` tinyint(1) DEFAULT '0' COMMENT '是否热门',
  `desc` text NOT NULL COMMENT '品牌简介',
  `site_url` varchar(255) NOT NULL DEFAULT '' COMMENT '品牌url',
  `sort_order` tinyint(3) unsigned NOT NULL DEFAULT '50' COMMENT '排序',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态',
  PRIMARY KEY (`id`),
  KEY `status` (`status`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='商品品牌';

