/*Table structure for table `shop_goods_category` */

DROP TABLE IF EXISTS `shop_goods_category`;

CREATE TABLE `shop_goods_category` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `pid` mediumint(8) unsigned DEFAULT '0' COMMENT '父类id',
  `name` varchar(16) DEFAULT NULL COMMENT '分类名称',
  `m_name` varchar(10) DEFAULT NULL COMMENT '简称',
  `pic` varchar(100) DEFAULT '' COMMENT '分类图片',
  `cover` varchar(100) DEFAULT NULL COMMENT '封面',
  `is_best` tinyint(1) DEFAULT '0' COMMENT '是否推荐',
  `is_index` tinyint(1) DEFAULT '0' COMMENT '是否首页分类',
  `freight_template` mediumint(8) DEFAULT '0' COMMENT '运费模板',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态',
  `sort_order` tinyint(3) DEFAULT '0' COMMENT '排序',
  `add_time` int(10) DEFAULT '0' COMMENT '添加时间',
  `update_time` int(10) DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

