/*Table structure for table `shop_goods_comment` */

DROP TABLE IF EXISTS `shop_goods_comment`;

CREATE TABLE `shop_goods_comment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(20) DEFAULT '' COMMENT '类型',
  `cat_id` mediumint(8) DEFAULT '0' COMMENT '商品分类ID',
  `goods_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商品id shop_goods.goods_id',
  `avatar_user` mediumint(8) DEFAULT '0' COMMENT '虚拟会员ID',
  `by_name` varchar(255) DEFAULT '' COMMENT '对应商品名/分类名',
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '用户id users.user_id',
  `order_id` bigint(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单id shop_order_info.order_id',
  `admin_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '添加管理员id main_admin_user.user_id',
  `review_admin_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '审核管理员id main_admin_user.user_id',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '审核状态,1待审核，2显示，3隐藏',
  `user_name` varchar(35) DEFAULT '' COMMENT '用户名 users.user_name',
  `headimgurl` varchar(255) NOT NULL DEFAULT '' COMMENT '用户头像 users.headimgurl',
  `is_imgs` tinyint(1) DEFAULT '0' COMMENT '是否上传图片',
  `content` varchar(500) NOT NULL DEFAULT '' COMMENT '评论内容',
  `sku_val` varchar(100) NOT NULL DEFAULT '' COMMENT '规格值 shop_order_goods.sku_val',
  `sku_name` varchar(100) NOT NULL DEFAULT '' COMMENT '规格名称 shop_order_goods.sku_name',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '录入时间',
  `review_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '审核时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `goods_id_order_id` (`goods_id`,`order_id`),
  KEY `user_id` (`user_id`),
  KEY `type_id` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='商品评论';

