/*Table structure for table `shop_order_goods` */

DROP TABLE IF EXISTS `shop_order_goods`;

CREATE TABLE `shop_order_goods` (
  `rec_id` bigint(15) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `order_id` bigint(10) unsigned NOT NULL DEFAULT '0' COMMENT '订单ID',
  `brand_id` mediumint(8) DEFAULT '0' COMMENT '品牌id',
  `cid` mediumint(8) DEFAULT '0' COMMENT '商品分类ID',
  `is_dividend` tinyint(1) DEFAULT '0' COMMENT '是否分销商品',
  `goods_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商品ID',
  `sku_val` varchar(100) DEFAULT '' COMMENT '规格值',
  `sku_name` varchar(100) DEFAULT '' COMMENT '规格名称',
  `goods_name` varchar(120) NOT NULL DEFAULT '' COMMENT '商品名称',
  `pic` varchar(255) DEFAULT '' COMMENT '商品图片',
  `goods_sn` varchar(60) NOT NULL DEFAULT '' COMMENT '商品货号',
  `goods_number` smallint(5) unsigned NOT NULL DEFAULT '1' COMMENT '订购数量',
  `market_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '市场售价',
  `shop_price` decimal(10,2) DEFAULT '0.00' COMMENT '商城售价',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品售价',
  `goods_weight` decimal(10,2) DEFAULT '0.00' COMMENT '商品重量',
  `discount` decimal(10,2) DEFAULT '0.00' COMMENT '商品折扣',
  `buy_again_discount` decimal(10,2) DEFAULT '0.00' COMMENT '复购折扣',
  `add_time` int(10) DEFAULT '0' COMMENT '购买时间',
  `user_id` mediumint(8) DEFAULT '0' COMMENT '购买会员ID',
  `is_evaluate` tinyint(1) DEFAULT '0' COMMENT '是否已评价，0不需要评论，1待评论，2已评论',
  `use_integral` int(10) DEFAULT '0' COMMENT '兑换所需积分',
  PRIMARY KEY (`rec_id`),
  KEY `order_id` (`order_id`),
  KEY `goods_id` (`goods_id`),
  KEY `user_id` (`user_id`),
  KEY `is_evalueate` (`is_evaluate`)
) ENGINE=InnoDB AUTO_INCREMENT=522 DEFAULT CHARSET=utf8;

