/*Table structure for table `users_account_log` */

DROP TABLE IF EXISTS `users_account_log`;

CREATE TABLE `users_account_log` (
  `log_id` bigint(15) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` mediumint(8) unsigned NOT NULL COMMENT '用户ID',
  `total_dividend` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '历史佣金总额-调整值',
  `old_total_dividend` decimal(10,2) DEFAULT '0.00' COMMENT '更换前-历史佣金总额',
  `total_integral` int(10) NOT NULL DEFAULT '0' COMMENT '总积分-调整值',
  `old_total_integral` int(10) DEFAULT '0' COMMENT '更换前-总积分',
  `balance_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '帐户余额-调整值',
  `old_balance_money` decimal(10,2) DEFAULT '0.00' COMMENT '更换前-帐户余额',
  `use_integral` int(10) NOT NULL DEFAULT '0' COMMENT '消费积分,可以用于兑换-调整值',
  `old_use_integral` int(10) DEFAULT '0' COMMENT '更换前-消费积分',
  `change_time` int(10) unsigned NOT NULL COMMENT '操作时间',
  `change_ip` varchar(30) DEFAULT NULL COMMENT '操作IP',
  `change_desc` varchar(255) NOT NULL COMMENT '操作备注',
  `change_type` tinyint(3) unsigned NOT NULL COMMENT '更改类型：1人工调整，2下单赠送，3商城购物，4佣金收入，5提现',
  `sign` varchar(32) DEFAULT '' COMMENT '签名',
  `by_id` mediumint(8) DEFAULT '0' COMMENT '相关ID，1为后台管理员ID，2,3，4为订单ID',
  PRIMARY KEY (`log_id`),
  KEY `user_id` (`user_id`),
  KEY `change_type` (`change_type`),
  KEY `by_id` (`by_id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='帐户明细流水';

