/*Table structure for table `users_withdraw_account` */

DROP TABLE IF EXISTS `users_withdraw_account`;

CREATE TABLE `users_withdraw_account` (
  `id` mediumint(8) NOT NULL AUTO_INCREMENT,
  `user_id` mediumint(8) NOT NULL COMMENT '用户ID',
  `type` set('bank','alipay') NOT NULL COMMENT '帐户类型',
  `bank_name` varchar(10) DEFAULT '' COMMENT '银行名称',
  `bank_code` varchar(10) DEFAULT '' COMMENT '银行代号',
  `bank_cardholder` varchar(20) DEFAULT '' COMMENT '银行-持卡人',
  `bank_card_number` varchar(30) DEFAULT '' COMMENT '银行-卡号',
  `bank_cardholder_phone` varchar(20) DEFAULT '' COMMENT '银行-持卡人电话',
  `bank_location_outlet` varchar(50) DEFAULT '' COMMENT '银行-网点所在地',
  `bank_branch_name` varchar(30) DEFAULT '' COMMENT '银行-支行名称',
  `alipay_user_name` varchar(30) DEFAULT '' COMMENT '支付宝-账户姓名',
  `alipay_account` varchar(30) DEFAULT '' COMMENT '支付宝-帐户',
  `add_time` int(10) DEFAULT '0' COMMENT '添加时间',
  `is_del` tinyint(1) DEFAULT '0' COMMENT '是否删除',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4;

