/*Table structure for table `users_withdraw_log` */

DROP TABLE IF EXISTS `users_withdraw_log`;

CREATE TABLE `users_withdraw_log` (
  `id` bigint(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '申请提现记录ID',
  `account_id` varchar(15) DEFAULT '' COMMENT '帐号Id',
  `amount` decimal(10,2) NOT NULL COMMENT '提现金额',
  `withdraw_fee` decimal(10,2) DEFAULT '0.00' COMMENT '提现手续费',
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '会员ID',
  `admin_id` mediumint(8) NOT NULL COMMENT '管理员ID',
  `add_time` int(10) NOT NULL DEFAULT '0' COMMENT '申请时间',
  `confirm_time` int(10) DEFAULT '0' COMMENT '确认时间',
  `refuse_time` int(10) DEFAULT '0' COMMENT '拒绝时间',
  `cancel_time` int(10) DEFAULT '0' COMMENT '取消时间',
  `complete_time` int(10) DEFAULT '0' COMMENT '打款时间',
  `update_time` int(10) NOT NULL DEFAULT '0' COMMENT '修改时间',
  `admin_note` varchar(255) NOT NULL DEFAULT '' COMMENT '管理员备注',
  `user_note` varchar(255) NOT NULL DEFAULT '' COMMENT '会员备注',
  `pay_info` varchar(255) DEFAULT '' COMMENT '打款信息',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态，0未确定，1,确认，处理中，2完成，3拒绝',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

